  ownMessage: {
    marginTop: "10px",
    backgroundColor: "purple",
    color: "white",
    textAlign: "left",
    minHeight: "10%"
  },
  otherMessage: {
    marginTop: "10px",
    backgroundColor: "blue",
    color: "white",
    textAlign: "right",
    minHeight: "10%"
  }
}));

export default function Message(props) {}
